#include<bits/stdc++.h>
using namespace std;
int main()
{
    int n;
    cin>>n;
    int a[n];
    for(int i=0;i<n;i++)
    {
        cin>>a[i];
    }
    sort(a,a+n);
    if(a[0]==a[n-1])
    {
        cout<<"NO";
        return 0;
    }
    cout<<"YES"<<endl;
    cout<<a[0]<<" "<<a[n-1]<<endl;
    return 0;
}

def main():
    n = int(input())
    a = list(map(int, input().split()))
    if n % 2 != 0:
        print("NO")
    elif len(set(a)) != len(a):
        print("NO")
    else:
        print("YES")
        print(min(a), max(a))


